import React from 'react';
import icon from '../../../assets/images/default.png';

const JobItem = () => {
    return (
        <div className="job__wrapper__card">
            <div className="job__wrapper__card--left">
                <img src={ icon } alt="icon" />
            </div>
        </div>
    );
};

export default JobItem;
